import search from './images/search_icon.svg';
import Menu from './images/Menu.svg';
import Einstellung from './images/Einstellungen.png';
import Info from './images/Info.png';
import './App.css';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom';
import Studentenliste from './Studentenliste'; // Import der neuen Seite

function App() {
  return (
    <div className="App">
      <header className="App-header">    
      <img src={Menu} className="Menu" alt="logo" />  
      <img src={Info} className="Info" alt="logo" />

      <img src={Einstellung} className="Einstellung" alt="logo" />
      </header>
      <div className="greeting-text">
         <b>Willkommen Max Mustermann</b>
      </div>
      <div className="search-bar">
         <img src={search} className="search-icon" alt="logo" />
      </div>
      <div className="box-field">
      <Router>
      <div>
        <h1>Startseite</h1>
        {/* Navigationslink zur neuen Seite */}
        <Link to="/Studentenliste">Zur neuen Seite</Link>

        <Route path="/" exact component={Home} />
          <Route path="/Studentenliste" component={Studentenliste} />
          {/* Weitere Routen */}

      </div>
    </Router>
